paramConversion.applyStepsToNormalizedParameterValue:
function applyStepsToNormalizedParameterValue(normalizedValue, steps) {
    if (steps == 1) {
        if (normalizedValue > 0) {
            normalizedValue = 1.;
        }
    } else {
        let oneStep = 1. / (steps - 1);
        let numberOfSteps = rnbo_fround(normalizedValue / oneStep * 1 / 1) * 1;
        normalizedValue = numberOfSteps * oneStep;
    }

    return normalizedValue;
}

paramConversion.convertToNormalizedParameterValue:
function convertToNormalizedParameterValue(index, value) {
    switch (index) {
    case 0:
    case 2:
    case 3:
    case 4:
    case 7:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));
            let normalizedValue = (value - 0) / (1 - 0);
            return normalizedValue;
        }
    case 6:
        {
            value = (value < 1 ? 1 : (value > 60 ? 60 : value));
            let normalizedValue = (value - 1) / (60 - 1);
            return normalizedValue;
        }
    case 5:
        {
            value = (value < 10 ? 10 : (value > 2000 ? 2000 : value));
            let normalizedValue = (value - 10) / (2000 - 10);
            return normalizedValue;
        }
    case 8:
        {
            value = (value < 100 ? 100 : (value > 4000 ? 4000 : value));
            let normalizedValue = (value - 100) / (4000 - 100);
            return normalizedValue;
        }
    case 1:
        {
            value = (value < 0.1 ? 0.1 : (value > 10 ? 10 : value));
            let normalizedValue = (value - 0.1) / (10 - 0.1);
            return normalizedValue;
        }
    default:
        return value;
    }
}

paramConversion.convertFromNormalizedParameterValue:
function convertFromNormalizedParameterValue(index, value) {
    value = (value < 0 ? 0 : (value > 1 ? 1 : value));

    switch (index) {
    case 0:
    case 2:
    case 3:
    case 4:
    case 7:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 0 + value * (1 - 0);
            }
        }
    case 6:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 1 + value * (60 - 1);
            }
        }
    case 5:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 10 + value * (2000 - 10);
            }
        }
    case 8:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 100 + value * (4000 - 100);
            }
        }
    case 1:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 0.1 + value * (10 - 0.1);
            }
        }
    default:
        return value;
    }
}

paramConversion.constrainParameterValue:
function constrainParameterValue(index, value) {
    var v = value;

    switch (index) {
    case 0:
        {
            v = (v > 1 ? 1 : (v < 0 ? 0 : v));
            return v;
        }
    case 1:
        {
            v = (v > 10 ? 10 : (v < 0.1 ? 0.1 : v));
            return v;
        }
    case 2:
        {
            v = (v > 1 ? 1 : (v < 0 ? 0 : v));
            return v;
        }
    case 3:
        {
            v = (v > 1 ? 1 : (v < 0 ? 0 : v));
            return v;
        }
    case 4:
        {
            v = (v > 1 ? 1 : (v < 0 ? 0 : v));
            return v;
        }
    case 5:
        {
            v = (v > 2000 ? 2000 : (v < 10 ? 10 : v));
            return v;
        }
    case 6:
        {
            v = (v > 60 ? 60 : (v < 1 ? 1 : v));
            return v;
        }
    case 7:
        {
            v = (v > 1 ? 1 : (v < 0 ? 0 : v));
            return v;
        }
    case 8:
        {
            v = (v > 4000 ? 4000 : (v < 100 ? 100 : v));
            return v;
        }
    default:
        return value;
    }
}
